CREATE TABLE `image`.`doctors` (`id` INT(11) NOT NULL AUTO_INCREMENT , `fname` VARCHAR(255) NULL DEFAULT NULL , `lname` VARCHAR(255) NULL DEFAULT NULL , `email` VARCHAR(255) NULL DEFAULT NULL , `password` VARCHAR(40) NULL DEFAULT NULL , `number` BIGINT(15) NULL DEFAULT NULL , `unique_id` INT(50) NULL DEFAULT NULL , `image` VARCHAR(255) NULL DEFAULT NULL , `rating` INT(1) NULL DEFAULT NULL , `time_of_avai` VARCHAR(16) NULL DEFAULT NULL , `time` DATETIME(6) NOT NULL DEFAULT CURRENT_TIMESTAMP , PRIMARY KEY (`id`)) ENGINE = InnoDB;